const claimRegex = /^#(?<id>\d+) @ (?<x>\d+),(?<y>\d+): (?<w>\d+)x(?<h>\d+)$/;

const parseClaim = (claim) => claim.match(claimRegex).groups;

const claims = input.split('\n').map(parseClaim);

const fabric = claims.reduce((fabric, claim) => {
  for(let y = +claim.y; y < +claim.y + +claim.h; y++) {
    for(let x = +claim.x; x < +claim.x + +claim.w; x++) {
      fabric[x+','+y] = (fabric[x+','+y] || 0) + 1;
    }
  }
  
  return fabric;
}, {});

const squareInchesWithMultipleClaims = Object.values(fabric).filter((claims) => claims > 1).length;

